INSERT INTO `recipes` (`rid`, `name`, `ingredients`, `directions`, `src`, `category`) VALUES
(111, 'Grandma''s Suet Pudding', '1 cup milk, 1 teaspoon lemon juice, 1 cup chopped suet, 1 cup molasses, 1 teaspoon baking soda, 2 cups all-purpose flour, 1 cup raisins, 1 egg white, beaten, 9 tablespoons confectioners'' sugar,  vanilla extract to taste, ', '<br />Sour the milk by adding the lemon juice.<br />In a large bowl combine suet, molasses, soured milk, baking soda, flour and raisins.  Place batter in a pudding mold or large double boiler and steam, uncovered, for 2 hours.<br />To make the sauce combine, in a small saucepan, the egg white, confectioner''s sugar and vanilla.  Heat over medium until thickened.  Serve over warm pudding.', 'http://images.media-allrecipes.com/images/44555.gif', 'TOP'),
(112, 'Banana Crumb Muffins', '1 1/2 cups all-purpose flour, 1 teaspoon baking soda, 1 teaspoon baking powder, 1/2 teaspoon salt, 3 bananas, mashed, 3/4 cup white sugar, 1 egg, lightly beaten, 1/3 cup butter, melted, 1/3 cup packed brown sugar, 2 tablespoons all-purpose flour, 1/8 teaspoon ground cinnamon, 1 tablespoon butter, ', '<br />Preheat oven to 375 degrees F (190 degrees C). Lightly grease 10 muffin cups, or line with muffin papers.<br />In a large bowl, mix together 1 1/2 cups flour, baking soda, baking powder and salt. In another bowl, beat together bananas, sugar, egg and melted butter. Stir the banana mixture into the flour mixture just until moistened. Spoon batter into prepared muffin cups.<br />In a small bowl, mix together brown sugar, 2 tablespoons flour and cinnamon. Cut in 1 tablespoon butter until mixture resembles coarse cornmeal. Sprinkle topping over muffins.<br />Bake in preheated oven for 18 to 20 minutes, until a toothpick inserted into center of a muffin comes out clean.', 'http://images.media-allrecipes.com/userphotos/250x250/00/69/52/695262.jpg', 'TOP'),
(113, 'World''s Best Lasagna', '1 pound sweet Italian sausage, 3/4 pound lean ground beef, 1/2 cup minced onion, 2 cloves garlic, crushed, 1 (28 ounce) can crushed tomatoes, 2 (6 ounce) cans tomato paste, 2 (6.5 ounce) cans canned tomato sauce, 1/2 cup water, 2 tablespoons white sugar, 1 1/2 teaspoons dried basil leaves, 1/2 teaspoon fennel seeds, 1 teaspoon Italian seasoning, 1 tablespoon salt, 1/4 teaspoon ground black pepper, 4 tablespoons chopped fresh parsley, 12 lasagna noodles, 16 ounces ricotta cheese, 1 egg, 1/2 teasp', '<br />In a Dutch oven, cook sausage, ground beef, onion, and garlic over medium heat until well browned. Stir in crushed tomatoes, tomato paste, tomato sauce, and water. Season with sugar, basil, fennel seeds, Italian seasoning, 1 tablespoon salt, pepper, and 2 tablespoons parsley. Simmer, covered, for about 1 1/2 hours, stirring occasionally.<br />Bring a large pot of lightly salted water to a boil. Cook lasagna noodles in boiling water for 8 to 10 minutes. Drain noodles, and rinse with cold water.  In a mixing bowl, combine ricotta cheese with egg, remaining parsley, and 1/2 teaspoon salt.<br />Preheat oven to 375  degrees F (190 degrees C).<br />To assemble, spread 1 1/2 cups of meat sauce in the bottom of a 9x13 inch baking dish.  Arrange 6 noodles lengthwise over meat sauce. Spread with one half of the ricotta cheese mixture. Top with a third of mozzarella cheese slices. Spoon 1 1/2 cups meat sauce over mozzarella, and sprinkle with 1/4 cup Parmesan cheese.  Repeat layers, and top with remaining mozzarella and Parmesan cheese. Cover with foil: to prevent sticking, either spray foil with cooking spray, or make sure the foil does not touch the cheese.<br />Bake in preheated oven for 25 minutes. Remove foil, and bake an additional 25 minutes. Cool for 15 minutes before serving.', 'http://images.media-allrecipes.com/userphotos/250x250/00/03/24/32427.jpg', 'TOP'),
(114, 'Delicious Ham and Potato Soup', '3 1/2 cups peeled and diced potatoes, 1/3 cup diced celery, 1/3 cup finely chopped onion, 3/4 cup diced cooked ham, 3 1/4 cups water, 2 tablespoons chicken bouillon granules, 1/2 teaspoon salt, or to taste, 1 teaspoon ground white or black pepper, or to taste, 5 tablespoons butter, 5 tablespoons all-purpose flour, 2 cups milk, ', '<br />Combine the potatoes, celery, onion, ham and water in a stockpot. Bring to a boil, then cook over medium heat until potatoes are tender, about 10 to 15 minutes. Stir in the chicken bouillon, salt and pepper.<br />In a separate saucepan, melt butter over medium-low heat. Whisk in flour with a fork, and cook, stirring constantly until thick, about 1 minute. Slowly stir in milk as not to allow lumps to form until all of the milk has been added. Continue stirring over medium-low heat until thick, 4 to 5 minutes.<br />Stir the milk mixture into the stockpot, and cook soup until heated through. Serve immediately.', 'http://images.media-allrecipes.com/userphotos/250x250/00/38/28/382870.jpg', 'TOP'),
(115, 'Chicken Pot Pie IX', '1 pound skinless, boneless chicken breast halves - cubed, 1 cup sliced carrots, 1 cup frozen green peas, 1/2 cup sliced celery, 1/3 cup butter, 1/3 cup chopped onion, 1/3 cup all-purpose flour, 1/2 teaspoon salt, 1/4 teaspoon black pepper, 1/4 teaspoon celery seed, 1 3/4 cups chicken broth, 2/3 cup milk, 2 (9 inch) unbaked pie crusts, ', '<br />Preheat oven to 425 degrees F (220 degrees C.)<br />In a saucepan, combine chicken, carrots, peas, and celery. Add water to cover and boil for 15 minutes. Remove from heat, drain and set aside.<br />In the saucepan over medium heat, cook onions in butter until soft and translucent. Stir in flour, salt, pepper, and celery seed. Slowly stir in chicken broth and milk. Simmer over medium-low heat until thick. Remove from heat and set aside.<br />Place the chicken mixture in bottom pie crust. Pour hot liquid mixture over. Cover with top crust, seal edges, and cut away excess dough. Make several small slits in the top to allow steam to escape.<br />Bake in the preheated oven for 30 to 35 minutes, or until pastry is golden brown and filling is bubbly. Cool for 10 minutes before serving.', 'http://images.media-allrecipes.com/userphotos/250x250/00/14/23/142350.jpg', 'TOP'),
(116, 'Downeast Maine Pumpkin Bread', '1 (15 ounce) can pumpkin puree, 4 eggs, 1 cup vegetable oil, 2/3 cup water, 3 cups white sugar, 3 1/2 cups all-purpose flour, 2 teaspoons baking soda, 1 1/2 teaspoons salt, 1 teaspoon ground cinnamon, 1 teaspoon ground nutmeg, 1/2 teaspoon ground cloves, 1/4 teaspoon ground ginger, ', '<br />Preheat oven to 350 degrees F (175 degrees C). Grease and flour three 7x3 inch loaf pans.<br />In a large bowl, mix together pumpkin puree, eggs, oil, water and sugar until well blended. In a separate bowl, whisk together the flour, baking soda, salt, cinnamon, nutmeg, cloves and ginger. Stir the dry ingredients into the pumpkin mixture until just blended. Pour into the prepared pans.<br />Bake for about 50 minutes in the preheated oven. Loaves are done when toothpick inserted in center comes out clean.', 'http://images.media-allrecipes.com/userphotos/250x250/00/13/23/132300.jpg', 'TOP'),
(117, 'Apple Pie by Grandma Ople', '1 recipe pastry for a 9 inch double crust pie, 1/2 cup unsalted butter, 3 tablespoons all-purpose flour, 1/4 cup water, 1/2 cup white sugar, 1/2 cup packed brown sugar, 8 Granny Smith apples - peeled, cored and sliced, ', '<br />Preheat oven to 425 degrees F (220 degrees C). Melt the butter in a saucepan. Stir in flour to form a paste. Add water, white sugar and brown sugar, and bring to a boil. Reduce temperature and let simmer.<br />Place the bottom crust in your pan. Fill with apples, mounded slightly. Cover with a lattice work crust.  Gently pour the sugar and butter liquid over the crust.  Pour slowly so that it does not run off.<br />Bake 15 minutes in the preheated oven. Reduce the temperature to 350 degrees F (175 degrees C). Continue baking for 35 to 45 minutes, until apples are soft.', 'http://images.media-allrecipes.com/userphotos/250x250/00/26/60/266012.jpg', 'TOP'),
(118, 'Clone of a Cinnabon', '1 cup warm milk (110 degrees F/45 degrees C), 2 eggs, room temperature, 1/3 cup margarine, melted, 4 1/2 cups bread flour, 1 teaspoon salt, 1/2 cup white sugar, 2 1/2 teaspoons bread machine yeast, 1 cup brown sugar, packed, 2 1/2 tablespoons ground cinnamon, 1/3 cup butter, softened, 1 (3 ounce) package cream cheese, softened, 1/4 cup butter, softened, 1 1/2 cups confectioners'' sugar, 1/2 teaspoon vanilla extract, 1/8 teaspoon salt, ', '<br />Place ingredients in the pan of the bread machine in the order recommended by the manufacturer. Select dough cycle; press Start.<br />After the dough has doubled in size turn it out onto a lightly floured surface, cover and let rest for 10 minutes. In a small bowl, combine brown sugar and cinnamon.<br />Roll dough into a 16x21 inch rectangle. Spread dough with 1/3 cup butter and sprinkle evenly with sugar/cinnamon mixture. Roll up dough and cut into 12 rolls. Place rolls in a lightly greased 9x13 inch baking pan. Cover and let rise until nearly doubled, about 30 minutes. Meanwhile, preheat oven to 400 degrees F (200 degrees C).<br />Bake rolls in preheated oven until golden brown, about 15 minutes. While rolls are baking, beat together cream cheese, 1/4 cup butter, confectioners'' sugar, vanilla extract and salt. Spread frosting on warm rolls before serving.', 'http://images.media-allrecipes.com/userphotos/250x250/00/03/64/36449.jpg', 'TOP'),
(119, 'Fluffy Pancakes', '3/4 cup milk, 2 tablespoons white vinegar, 1 cup all-purpose flour, 2 tablespoons white sugar, 1 teaspoon baking powder, 1/2 teaspoon baking soda, 1/2 teaspoon salt, 1 egg, 2 tablespoons butter, melted,  cooking spray, ', '<br />Combine milk with vinegar in a medium bowl and set aside for 5 minutes to &#34;sour&#34;.<br />Combine flour, sugar, baking powder, baking soda, and salt in a large mixing bowl. Whisk egg and butter into &#34;soured&#34; milk. Pour the flour mixture into the wet ingredients and whisk until lumps are gone.<br />Heat a large skillet over medium heat, and coat with cooking spray. Pour 1/4 cupfuls of batter onto the skillet, and cook until bubbles appear on the surface. Flip with a spatula, and cook until browned on the other side.', 'http://images.media-allrecipes.com/userphotos/250x250/00/58/51/585138.jpg', 'TOP'),
(120, 'Mom''s Zucchini Bread', '3 cups all-purpose flour, 1 teaspoon salt, 1 teaspoon baking soda, 1 teaspoon baking powder, 3 teaspoons ground cinnamon, 3 eggs, 1 cup vegetable oil, 2 1/4 cups white sugar, 3 teaspoons vanilla extract, 2 cups grated zucchini, 1 cup chopped walnuts, ', '<br />Grease and flour two 8 x 4 inch pans.  Preheat oven to 325 degrees F (165 degrees C).<br />Sift flour, salt, baking powder, soda, and cinnamon together in a bowl.<br />Beat eggs, oil, vanilla, and sugar together in a large bowl.  Add sifted ingredients to the creamed mixture, and beat well.  Stir in zucchini and nuts until well combined.  Pour batter into prepared pans.<br />Bake for 40 to 60 minutes, or until tester inserted in the center comes out clean.  Cool in pan on rack for 20 minutes.  Remove bread from pan, and completely cool.', 'http://images.media-allrecipes.com/userphotos/250x250/00/31/77/317763.jpg', 'TOP'),
(121, 'Too Much Chocolate Cake', '1 (18.25 ounce) package devil''s food cake mix, 1 (5.9 ounce) package instant chocolate pudding mix, 1 cup sour cream, 1 cup vegetable oil, 4 eggs, 1/2 cup warm water, 2 cups semisweet chocolate chips, ', '<br />Preheat oven to 350 degrees F (175 degrees C).<br />In a large bowl, mix together the cake and pudding mixes, sour cream, oil, beaten eggs and water.  Stir in the chocolate chips and pour batter into a well greased 12 cup bundt pan.<br />Bake for 50 to 55 minutes, or until top is springy to the touch and a wooden toothpick inserted comes out clean. Cool cake thoroughly in pan at least an hour and a half before inverting onto a plate  If desired, dust the cake with powdered sugar.', 'http://images.media-allrecipes.com/userphotos/250x250/00/51/87/518798.jpg', 'TOP'),
(122, 'Chicken Cordon Bleu II', '6 skinless, boneless chicken breast halves, 6 slices Swiss cheese, 6 slices ham, 3 tablespoons all-purpose flour, 1 teaspoon paprika, 6 tablespoons butter, 1/2 cup dry white wine, 1 teaspoon chicken bouillon granules, 1 tablespoon cornstarch, 1 cup heavy whipping cream, ', '<br />Pound chicken breasts if they are too thick. Place a cheese and ham slice on each breast within 1/2 inch of the edges. Fold the edges of the chicken over the filling, and secure with toothpicks. Mix the flour and paprika in a small bowl, and coat the chicken pieces.<br />Heat the butter in a large skillet over medium-high heat, and cook the chicken until browned on all sides. Add the wine and bouillon. Reduce heat to low, cover, and simmer for 30 minutes, until chicken is no longer pink and juices run clear.<br />Remove the toothpicks, and transfer the breasts to a warm platter. Blend the cornstarch with the cream in a small bowl, and whisk slowly into the skillet. Cook, stirring until thickened, and pour over the chicken. Serve warm.', 'http://images.media-allrecipes.com/userphotos/250x250/00/40/93/409340.jpg', 'TOP'),
(123, 'Guacamole', '3 avocados - peeled, pitted, and mashed, 1 lime, juiced, 1 teaspoon salt, 1/2 cup diced onion, 3 tablespoons chopped fresh cilantro, 2 roma (plum) tomatoes, diced, 1 teaspoon minced garlic, 1 pinch ground cayenne pepper, ', '<br />In a medium bowl, mash together the avocados, lime juice, and salt. Mix in onion, cilantro, tomatoes, and garlic. Stir in cayenne pepper. Refrigerate 1 hour for best flavor, or serve immediately.', 'http://images.media-allrecipes.com/global/recipes/big/14231.jpg', 'TOP'),
(124, 'Grandmother''s Buttermilk Cornbread', '1/2 cup butter, 2/3 cup white sugar, 2 eggs, 1 cup buttermilk, 1/2 teaspoon baking soda, 1 cup cornmeal, 1 cup all-purpose flour, 1/2 teaspoon salt, ', '<br />Preheat oven to 375 degrees F (175 degrees C). Grease an 8 inch square pan.<br />Melt butter in large skillet. Remove from heat and stir in sugar. Quickly add eggs and beat until well blended. Combine buttermilk with baking soda and stir into mixture in pan. Stir in cornmeal, flour, and salt until well blended and few lumps remain. Pour batter into the prepared pan.<br />Bake in the preheated oven for 30 to 40 minutes, or until a toothpick inserted in the center comes out clean.', 'http://images.media-allrecipes.com/userphotos/250x250/00/69/69/696905.jpg', 'TOP'),
(125, 'Annie''s Fruit Salsa and Cinnamon Chips', '2 kiwis, peeled and diced, 2 Golden Delicious apples - peeled, cored and diced, 8 ounces raspberries, 1 pound strawberries, 2 tablespoons white sugar, 1 tablespoon brown sugar, 3 tablespoons fruit preserves, any flavor, 10 (10 inch) flour tortillas, 2 tablespoons butter flavored cooking spray,  cinnamon sugar, ', '<br />In a large bowl, thoroughly mix kiwis, Golden Delicious apples, raspberries, strawberries, white sugar, brown sugar and fruit preserves. Cover and chill in the refrigerator at least 15 minutes.<br />Preheat oven to 350 degrees F (175 degrees C).<br />Coat one side of each flour tortilla with butter flavored cooking spray. Cut into wedges and arrange in a single layer on a large baking sheet. Sprinkle wedges with desired amount of cinnamon sugar. Spray again with cooking spray.<br />Bake in the preheated oven 8 to 10 minutes. Repeat with any remaining tortilla wedges. Allow to cool approximately 15 minutes. Serve with chilled fruit mixture.', 'http://images.media-allrecipes.com/userphotos/250x250/00/07/81/78163.jpg', 'TOP'),
(126, 'Boilermaker Tailgate Chili', '2 pounds ground beef chuck, 1 pound bulk Italian sausage, 3 (15 ounce) cans chili beans, drained, 1 (15 ounce) can chili beans in spicy sauce, 2 (28 ounce) cans diced tomatoes with juice, 1 (6 ounce) can tomato paste, 1 large yellow onion, chopped, 3 stalks celery, chopped, 1 green bell pepper, seeded and chopped, 1 red bell pepper, seeded and chopped, 2 green chile peppers, seeded and chopped, 1 tablespoon bacon bits, 4 cubes beef bouillon, 1/2 cup beer, 1/4 cup chili powder, 1 tablespoon Worce', '<br />Heat a large stock pot over medium-high heat. Crumble the ground chuck and sausage into the hot pan, and cook until evenly browned. Drain off excess grease.<br />Pour in the chili beans, spicy chili beans, diced tomatoes and tomato paste. Add the onion, celery, green and red bell peppers, chile peppers, bacon bits, bouillon, and beer. Season with chili powder, Worcestershire sauce, garlic, oregano, cumin, hot pepper sauce, basil, salt, pepper, cayenne, paprika, and sugar. Stir to blend, then cover and simmer over low heat for at least 2 hours, stirring occasionally.<br />After 2 hours, taste, and adjust salt, pepper, and chili powder if necessary. The longer the chili simmers, the better it will taste. Remove from heat and serve, or refrigerate, and serve the next day.<br />To serve, ladle into bowls, and top with corn chips and shredded Cheddar cheese.', 'http://images.media-allrecipes.com/userphotos/250x250/00/02/93/29331.jpg', 'TOP'),
(127, 'Taco Seasoning I', '1 tablespoon chili powder, 1/4 teaspoon garlic powder, 1/4 teaspoon onion powder, 1/4 teaspoon crushed red pepper flakes, 1/4 teaspoon dried oregano, 1/2 teaspoon paprika, 1 1/2 teaspoons ground cumin, 1 teaspoon sea salt, 1 teaspoon black pepper, ', '<br />In a small bowl, mix together chili powder, garlic powder, onion powder, red pepper flakes, oregano, paprika, cumin, salt and pepper. Store in an airtight container.', 'http://images.media-allrecipes.com/userphotos/250x250/00/10/90/109067.jpg', 'TOP'),
(128, 'Banana Sour Cream Bread', '1/4 cup white sugar, 1 teaspoon ground cinnamon, 3/4 cup butter, 3 cups white sugar, 3 eggs, 6 very ripe bananas, mashed, 1 (16 ounce) container sour cream, 2 teaspoons vanilla extract, 2 teaspoons ground cinnamon, 1/2 teaspoon salt, 3 teaspoons baking soda, 4 1/2 cups all-purpose flour, 1 cup chopped walnuts, ', '<br />Preheat oven to 300 degrees F (150 degrees C). Grease four 7x3 inch loaf pans. In a small bowl, stir together 1/4 cup white sugar and 1 teaspoon cinnamon. Dust pans lightly with cinnamon and sugar mixture.<br />In a large bowl, cream butter and 3 cups sugar. Mix in eggs, mashed bananas, sour cream, vanilla and cinnamon. Mix in salt, baking soda and flour. Stir in nuts.  Divide into prepared pans.<br />Bake for 1 hour, until a toothpick inserted in center comes out clean.', 'http://images.media-allrecipes.com/userphotos/250x250/00/17/74/177469.jpg', 'TOP'),
(129, 'Amish White Bread', '2 cups warm water (110 degrees F/45 degrees C), 2/3 cup white sugar, 1 1/2 tablespoons active dry yeast, 1 1/2 teaspoons salt, 1/4 cup vegetable oil, 6 cups bread flour, ', '<br />In a large bowl, dissolve the sugar in warm water, and then stir in yeast. Allow to proof until yeast resembles a creamy foam.<br />Mix salt and oil into the yeast. Mix in flour one cup at a time. Knead dough on a lightly floured surface until smooth. Place in a well oiled bowl, and turn dough to coat. Cover with a damp cloth. Allow to rise until doubled in bulk, about 1 hour.<br />Punch dough down. Knead for a few minutes, and divide in half. Shape into loaves, and place into two well oiled 9x5 inch loaf pans. Allow to rise for 30 minutes, or until dough has risen 1 inch above pans.<br />Bake at 350 degrees F (175 degrees C) for 30 minutes.', 'http://images.media-allrecipes.com/userphotos/250x250/00/03/75/37510.jpg', 'TOP'),
(130, 'BBQ Pork for Sandwiches', '1 (14 ounce) can beef broth, 3 pounds boneless pork ribs, 1 (18 ounce) bottle barbeque sauce, ', '<br />Pour can of beef broth into slow cooker, and add boneless pork ribs. Cook on High heat for 4 hours, or until meat shreds easily. Remove meat, and shred with two forks. It will seem that it''s not working right away, but it will.<br />Preheat oven to 350 degrees F (175 degrees C). Transfer the shredded pork to a Dutch oven or iron skillet, and stir in barbeque sauce.<br />Bake in the preheated oven for 30 minutes, or until heated through.', 'http://images.media-allrecipes.com/userphotos/250x250/00/01/89/18978.jpg', 'TOP'),
(135, 'Reinvented Turkey Leftovers Soup', '1 teaspoon olive oil, 2 carrots, peeled and chopped, 1 onion, chopped, 1 stalk celery, chopped, 1/2 cup dry white wine, 1 turkey carcass, 4 cups chicken stock, 4 cups water, 1 bay leaf, 1 bouquet garni of fresh parsley and thyme, 2 cups leftover roast turkey, pulled into bite-sized pieces, 1 carrot, finely diced, 2 tablespoons chopped fresh tarragon, ', '<br />Heat olive oil in a large stockpot over medium-high heat. Cook and stir 2 chopped carrots, onion, and celery until onion is golden, 7 to 10 minutes. Pour in wine and bring to a simmer. Add turkey carcass, chicken stock, water, bay leaf,  and bouquet garni; bring mixture to a boil.<br />Reduce heat to a simmer and cook, partially covered, for about 1 hour. Skim any fat that comes to the surface and discard.<br />Remove turkey carcass and strain soup into a large saucepan over medium heat. Stir in leftover turkey and diced carrot; simmer until warmed through, about 5 minutes. Serve garnished with fresh tarragon.', 'http://images.media-allrecipes.com/images/44555.gif', 'NEW'),
(136, 'Bacon Sweet Potato Cornbread', '5 slices bacon, 1 1/4 cups cornmeal, 1 teaspoon salt, 1/2 teaspoon baking soda, 1 cup mashed cooked sweet potato, 1 cup buttermilk, 2 eggs, lightly beaten, ', '<br />Preheat oven to 450 degrees F (230 degrees C).<br />Cook and stir bacon in a 9-inch cast-iron skillet over medium-high heat until browned, about 10 minutes. Remove and chop bacon, leaving 1 tablespoon of bacon drippings in skillet.<br />Whisk cornmeal, salt, and baking soda in a bowl. Stir sweet potato, buttermilk, and eggs together in a separate bowl until thoroughly combined. Stir sweet potato mixture into dry ingredients and mix chopped bacon into batter. Pour batter into the cast-iron skillet.<br />Bake corn bread in the preheated oven until browned and bread feels firm to the touch, about 30 minutes. Turn corn bread onto a serving plate and cut into wedges for serving.', 'http://images.media-allrecipes.com/userphotos/250x250/00/92/51/925136.jpg', 'NEW'),
(137, 'Albondigas (Meatballs) en Chipotle', '5 tomatoes, chopped, 1 small onion, 1 clove garlic, 1 tablespoon adobo sauce from chipotle peppers, 3 tablespoons vegetable oil, 3 cups chicken stock, 4 fresh tomatillos, husks removed, 2 eggs, 1 small onion, 2 chipotle peppers in adobo sauce, 2 cloves garlic, 1 tablespoon chicken bouillon granules, 5 sprigs fresh cilantro, chopped, 1 pound ground beef, 1 pound ground pork, 1 cup cooked rice, ', '<br />Blend tomatoes, 1 onion, 1 clove garlic, and adobo sauce in a blender or food processor until smooth.<br />Heat oil in a large skillet over medium heat; cook and stir tomato mixture in hot oil until fragrant, about 10 minutes. Stir in chicken stock and continue to cook for 10 minutes more.<br />Meanwhile, blend tomatillos, eggs, 1 small onion, chipotle peppers, 2 cloves garlic, chicken bouillon, and cilantro in a blender or food processor until smooth. Transfer mixture to a large bowl and add beef, pork, and rice; stir to combine. Roll meat mixture into walnut-sized balls.<br />Transfer meatballs to tomato mixture; simmer until meatballs are no longer pink in the center, 15 to 20 minutes.', 'http://images.media-allrecipes.com/images/44555.gif', 'NEW'),
(138, 'Honey Glazed Carrots and Pears', '3 Anjou pears, peeled and cut into chunks, 3 pounds carrots, peeled and sliced, 1 cup butter, 2 tablespoons brown sugar, 2 tablespoons honey, 1 teaspoon ground cinnamon, 1/2 teaspoon ground nutmeg, 1 tablespoon chopped fresh parsley, or as needed, ', '<br />Place a steamer insert into a saucepan and fill with water to just below the bottom of the steamer. Bring water to a boil. Add pears; cover and steam until tender, 5 to 10 minutes. Transfer pears to a bowl. Add carrots to steamer, cover, and cook until tender, about 10 minutes; add carrots to bowl with pears.<br />Heat butter in a saucepan over medium heat; stir in brown sugar, honey, cinnamon, and nutmeg. Bring to a simmer, stirring occasionally, until sugar has melted and glaze is slightly reduced, 5 to 10 minutes.<br />Pour glaze over pears and carrots; toss to coat. Remove pears and carrots with a slotted spoon and transfer to a serving dish; sprinkle with parsley.', 'http://images.media-allrecipes.com/images/44555.gif', 'NEW'),
(139, 'Cheesy Breakfast Pizza', '1 (8 ounce) package refrigerated crescent rolls, 1 cup frozen hash brown potatoes, thawed, 1 cup shredded mozzarella cheese, 5 eggs, beaten, 1/4 cup milk, 1/2 teaspoon salt, 1/2 teaspoon ground black pepper, 2 tablespoons grated Parmesan cheese, ', '<br />Preheat oven to 375 degrees F (190 degrees C). Grease a 10x15-inch baking pan.<br />Unroll crescent roll dough and press into the prepared baking pan. Sprinkle hash browns and mozzarella cheese over the crescent roll dough.<br />Whisk eggs, milk, salt, and black pepper together in a bowl; pour over potato-cheese layer. Top with Parmesan cheese.<br />Bake in the preheated oven until eggs are set in the middle and cheeses are melted, about 30 minutes.', 'http://images.media-allrecipes.com/images/44555.gif', 'NEW'),
(140, 'Berry Cranberry Sauce', '1 cup orange juice, 1 cup water, 1/2 cup white sugar, 1/4 cup honey, 2 (12 ounce) packages cranberries, 2 cups blueberries, 1 cup raspberries, 1 orange, juiced and zested, 1/8 teaspoon pumpkin pie spice, ', '<br />Stir 1 cup orange juice, water, sugar, and honey together in a large saucepan. Bring to a boil and stir cranberries, blueberries, raspberries, orange juice, and orange zest into mixture. Reduce heat to low and simmer, mashing berries occasionally to create a thicker texture, 15 to 20 minutes. Stir pumpkin pie spice into sauce. Refrigerate at least 3 hours up to overnight before serving.', 'http://images.media-allrecipes.com/images/44555.gif', 'NEW'),
(141, 'Candy-Bar Fudge', '6 (2.07 ounce) candy bars, 2 teaspoons butter for greasing, or as needed, 3 cups white sugar, 3/4 cup butter, 2/3 cup evaporated milk, 2 cups semisweet chocolate chips, 1 (7 ounce) jar marshmallow creme, 1 teaspoon vanilla extract, ', '<br />Place candy bars into freezer for about 10 minutes to firm; slice 1/2-inch to 3/4-inch thick.<br />Line a 9-inch square baking dish with aluminum foil amd grease with butter.<br />Heat sugar, 3/4 cup butter, and evaporated milk in a saucepan over medium heat, stirring to melt butter and dissolve sugar. Bring mixture to a boil and cook, stirring constantly, until a candy thermometer inserted into the middle of the syrup reads 234 degrees F (110 degrees C), 3 to 5 minutes. Remove from heat and stir chocolate chips into syrup until melted and smooth. Stir marshmallow cream and vanilla extract into mixture to make a smooth fudge.<br />Spread half the fudge into the prepared dish and layer the candy bar pieces over the fudge; pour remaining fudge on top of candy bars. Let cool to room temperature before cutting into squares.', 'http://images.media-allrecipes.com/images/44555.gif', 'NEW'),
(142, 'Cast-Iron Skillet Prime Rib Roast and Gravy', '1 (4.5 pound) beef prime rib roast at room temperature, 1 coarse sea salt, or as needed, 1/4 cup freshly ground black pepper, or as needed, 1/4 cup onion, quartered, 1/4 cup unsalted butter, 1 (32 ounce) carton all-purpose flour, 4 sprigs red wine,  beef stock,  fresh thyme, ', '<br />Preheat oven to 275 degrees F (135 degrees C).<br />Rub beef roast with sea salt and black pepper. Heat a large cast-iron skillet over medium-high heat; sear roast on all sides in the hot skillet, 2 to 3 minutes per side. Turn roast so the ribs and fat side are facing up.<br />Roast prime rib in the preheated oven for 45 minutes; scatter onion quarters around roast and continue cooking until an instant-read meat thermometer inserted into the thickest part of the meat reads 130 degrees F (54 degrees C) for rare, about 2 more hours.<br />Remove roast from skillet, wrap meat in aluminum foil, and let rest for 15 to 20 minutes to let juices reabsorb into the meat. Leave onion pieces in skillet.<br />Pour drippings from skillet into a bowl and skim off excess grease. Return degreased drippings to skillet with onion pieces, place over medium heat, and melt butter in the drippings. Whisk flour into mixture to make a paste, 1 to 2 minutes. Stir red wine into flour paste until smooth. Mix beef stock into pan gravy until smooth; stir thyme sprigs into gravy.<br />Reduce heat to low and simmer gravy until thickened, 5 to 8 minutes. Strain gravy, discard onion pieces and thyme, and serve with prime rib.', 'http://images.media-allrecipes.com/images/44555.gif', 'NEW'),
(143, 'Christmas Ham', '1 (5 pound) bone-in ham, 1/2 cup Dijon mustard, 1/2 cup packed brown sugar, 1/4 cup whole cloves, 1 quart peach nectar, 1 (20 ounce) can pineapple rings, juice drained and reserved, 1 (4 ounce) jar maraschino cherries, juice drained and reserved, ', '<br />Place ham into a large pot, cover with water, and bring to a boil. Reduce heat to medium-low and simmer ham for 1 to 2 hours. Cut away and discard any rind and visible fat.<br />Preheat oven to 325 degrees F (165 degrees C).<br />Score the ham in a diamond pattern and place into a roasting pan. Stir Dijon mustard and brown sugar in a bowl until thoroughly combined; brush mustard mixture onto the ham. Press a whole clove into the center of each scored diamond shape. Pour peach nectar into the roasting pan. Combine pineapple and maraschino liquid in a small bowl.<br />Bake ham in the preheated oven for 3 hours, basting frequently with the pineapple juice mixture and peach nectar.<br />Arrange pineapple rings over the ham and secure with toothpicks. Secure a maraschino cherry in the center of each pineapple ring with a toothpick.<br />Bake ham until browned, tender, and fragrant, 1 to 2 more hours, basting ham and fruit frequently with pineapple juice mixture and pan juices.', 'http://images.media-allrecipes.com/images/44555.gif', 'NEW'),
(144, 'Crunchy Bread Stix - Fowlerville Pizzeria Style', '2 1/2 cups unbleached all-purpose flour, 1 cup water, 1 1/2 teaspoons instant yeast, 3 tablespoons nonfat dry milk powder, 3 tablespoons olive oil, 1 teaspoon salt, 1 tablespoon olive oil, 1/4 cup toasted sesame seeds, ', '<br />Combine flour, water, yeast, dry milk powder, 3 tablespoons olive oil, and salt in the mixing bowl of a large stand mixer; knead into a soft, smooth dough, about 7 minutes.<br />Place into a warm area and let rise until doubled, 1 to 1 1/2 hours.<br />Transfer dough to an oiled work surface; roll with a rolling pin into a 10x20-inch rectangle. Brush dough with 1 tablespoon olive oil and sprinkle with sesame seeds. Roll dough again lightly to press seeds into surface. Use a pizza wheel or sharp knife to cut dough along the shorter edge into 1/4- to 1/2-inch wide strips. Hold each breadstick by both ends and twist once.<br />Grease baking sheets or line with parchment paper. Transfer bread sticks to prepared baking sheets; cover with a kitchen towel and set aside for 30 minutes.<br />Preheat oven to 425 degrees F (220 degrees C).<br />Bake bread sticks in the preheated oven until golden brown, 12 to 14 minutes.', 'http://images.media-allrecipes.com/images/44555.gif', 'NEW'),
(145, 'Christmas Ham Glaze', '2 (12 fluid ounce) cans or bottles beer, 2/3 cup dark brown sugar, 3 tablespoons Dijon mustard, 1 (6 ounce) can frozen orange juice concentrate, thawed, 1 teaspoon ground cloves, ', '<br />Whisk beer, brown sugar, Dijon mustard, orange juice concentrate, and cloves in a bowl until sugar has dissolved.', 'http://images.media-allrecipes.com/images/44555.gif', 'NEW'),
(146, 'Easiest Yummiest Meat Loaf', '1 pound ground beef, 1 1/2 cups rolled oats, 1 (10.5 ounce) can French onion soup (such as Campbell''s &#174;), 2 eggs, beaten, ', '<br />Preheat oven to 375 degrees F (190 degrees C). Grease an 8-inch square baking dish.<br />Combine ground beef, rolled oats, French onion soup, and eggs in a bowl until thoroughly combined; transfer to prepared baking dish.<br />Bake in the preheated oven until the meat loaf is no longer pink in the middle and an instant-read meat thermometer inserted into the center of the loaf reads at least 160 degrees F (70 degrees C), 60 to 75 minutes.', 'http://images.media-allrecipes.com/images/44555.gif', 'NEW'),
(147, 'Homemade Cranberry Ginger Sauce ', '2 oranges, zested and juiced, 1/2 cup honey, or more to taste, 2 pieces of crystallized ginger, chopped - or more to taste, 1 cinnamon stick, 1/4 teaspoon salt, 1 (12 ounce) package fresh cranberries, ', '<br />Stir orange zest and juice, honey, crystallized ginger, cinnamon stick, and salt in a saucepan over medium heat; bring to a simmer. Stir cranberries into orange juice mixture, cover, and bring to a boil; let boil for 1 minute. Reduce heat to low. Simmer cranberry sauce until cranberries have popped, about 15 minutes. Remove from heat and discard cinnamon stick. If a sweeter sauce is desired, stir in more honey. Serve warm or chilled.', 'http://images.media-allrecipes.com/images/44555.gif', 'NEW'),
(148, 'Pomegranate Cranberry Sauce/Relish', '1 pound cranberries, 1 (16 fl oz) bottle pomegranate juice (such as POM&#174; Wonderful), 1 1/2 cups white sugar, 1/2 cup chopped walnuts, ', '<br />Place cranberries into a saucepan and pour in pomegranate juice. Cover and bring to a boil until cranberries begin to pop. Reduce heat to medium and stir sugar into cranberry mixture. Cook, mashing often with a spoon or potato masher, until cranberries have broken, about 5 minutes. Cover and reduce heat to low; simmer to fully dissolve sugar, 2 to 3 minutes. Stir walnuts into cranberry sauce before serving. Transfer into a serving dish and chill before serving.', 'http://images.media-allrecipes.com/images/44555.gif', 'NEW'),
(149, 'Pork Chops in Mushroom Gravy', '1 tablespoon olive oil, 4 bone-in pork chops, 1 teaspoon garlic salt, 1 teaspoon ground black pepper, 1 tablespoon olive oil, 1 (6 ounce) package sliced fresh mushrooms, 1 (10.75 ounce) can golden mushroom soup (such as Campbell''s&#174;), 2 tablespoons water, ', '<br />Heat 1 tablespoon olive oil in a large skillet over medium heat. Sprinkle pork chops with garlic salt and black pepper. Fry pork chops in the hot oil until browned, 5 to 8 minutes per side. Transfer chops to a plate.<br />Heat 1 tablespoon olive oil in skillet; cook and stir mushrooms in the hot oil until soft, 5 to 8 minutes. Scrape up and dissolve any browned bits of food into mushrooms as you stir. Pour golden mushroom soup and water into skillet and stir into mushrooms.<br />Place pork chops and accumulated juices into mushroom sauce, spooning sauce over chops. Simmer until meat is no longer pink inside and juices run clear, occasionally spooning more sauce over chops as they cook, 10 to 15 minutes.', 'http://images.media-allrecipes.com/images/44555.gif', 'NEW'),
(150, 'Shrike''s Prime Rib with Whiskey Sauce', '1/2 cup soy sauce, 1 (4 fluid ounce) bottle liquid hickory smoke flavoring, 2 cups kosher salt, 1 cup white sugar, 2 tablespoons ground black pepper, 2 tablespoons garlic powder, 7 1/2 pounds beef standing rib roast, 2 tablespoons butter, 1 tablespoon olive oil, 2 bunches green onions, chopped, 1 cup beef broth, 1/2 cup bourbon whiskey, 2 fluid ounces triple sec, 1/2 cup white sugar, 1/4 cup brown sugar, 6 tablespoons butter, 2 tablespoons cornstarch, or as desired, 2 tablespoons water, ', '<br />Mix soy sauce, liquid smoke flavoring, kosher salt, 1 cup white sugar, black pepper, and garlic powder in a large nonstick skillet. Bring to a boil, reduce heat to low, and stir constantly until the mixture becomes thick and paste-like, 5 to 10 minutes. Remove from heat and let the mixture cool.<br />Coat beef roast completely with rub paste and cover roast with plastic wrap. Place wrapped roast on a baking sheet and refrigerate 1 to 2 days to infuse flavor into the meat.<br />Remove roast from refrigerator, unwrap, and let stand until meat reaches room temperature, about 2 hours.<br />Preheat oven to 500 degrees F (260 degrees C).<br />Cook roast in preheated oven for 10 minutes only; reduce oven heat to 250 degrees F (120 degrees C), leaving the oven door slightly open as the temperature drops, until oven temperature reaches about 300 degrees.<br />Roast the meat until temperature reaches your desired degree of doneness, 2 to 3 hours. An instant-read meat thermometer inserted into the center of the roast reads 130 degrees F (54 degrees C) for rare, 140 degrees F (60 degrees C) for medium-rare, 150 degrees F (65 degrees C) for medium, or 160 degrees F (70 degrees C) for well done. Temperature will continue to rise as the meat rests.<br />Let roast rest for 15 minutes to redistribute juices; scrape off the rub mixture.<br />While meat is resting, heat 2 tablespoons butter with olive oil in a large skillet over medium heat. Cook and stir green onions in the hot oil and butter until browned, 10 to 15 minutes. Stir beef broth, bourbon whiskey, triple sec, 1/2 cup white sugar, and brown sugar into green onions, stirring to combine and dissolve sugars. Bring to a simmer, reduce heat to low, and cook until flavors have blended, about 5 minutes. Melt remaining 6 tablespoons butter into sauce and simmer until butter is smoothly incorporated into sauce.<br />Shake cornstarch with water in a small lidded jar and whisk cornstarch mixture into sauce. Simmer until thickened, about 5 minutes. Serve sauce with meat.', 'http://images.media-allrecipes.com/images/44555.gif', 'NEW'),
(151, 'Tangy Mustard Sauce for Ham', '1/2 cup white vinegar, 1/2 cup butter, 1/2 cup tomato soup, 1/2 cup white sugar, 1/2 cup prepared mustard, 3 eggs, ', '<br />Whisk vinegar, butter, tomato soup, sugar, mustard, and eggs in a saucepan over medium heat, whisking until smooth. Bring to a simmer and whisk constantly until the glaze bubbles and thickens, about 10 minutes.', 'http://images.media-allrecipes.com/images/44555.gif', 'NEW'),
(152, 'Cranberry Corn Bread', '1/2 cup chopped cranberries, 1 tablespoon white sugar, 1 1/2 cups all-purpose flour, 1 cup yellow cornmeal, 1/2 cup white sugar, 1 tablespoon baking powder, 1/2 teaspoon baking soda, 1/4 teaspoon salt, 1 1/3 cups milk, 2 eggs, beaten, 3 tablespoons butter, melted, ', '<br />Preheat oven to 425 degrees F (220 degrees C). Grease an 8-inch square baking dish.<br />Stir cranberries with 1 tablespoon of sugar in a bowl. Whisk flour, cornmeal, 1/2 cup sugar, baking powder, baking soda, and salt in a separate bowl. Whisk milk, eggs, and melted butter together in a third bowl. Pour milk mixture into dry ingredients and stir just until moistened. Stir cranberries into batter; pour into prepared baking dish.<br />Bake in the preheated oven until corn bread is golden brown, 18 to 20 minutes. Let cool completely in pan before cutting into squares for serving.', 'http://images.media-allrecipes.com/images/44555.gif', 'NEW'),
(153, 'Stuffed Greek Leg of Lamb', '1 (3 1/2) pound leg of lamb, butterflied, 2 tablespoons olive oil, or as needed, 2 tablespoons chopped fresh oregano, 1 (12 ounce) jar chopped fresh basil, 1 (8 ounce) package marinated artichoke hearts, drained and chopped, 1 (6 ounce) jar crumbled feta cheese, 3 cloves sun-dried tomatoes packed in oil, drained and chopped,  garlic, minced,  salt and ground black pepper to taste, ', '<br />Preheat oven to 350 degrees F (175 degrees C).<br />Lay out the leg of lamb on cutting board with the inside of the lamb facing you. Drizzle olive oil evenly over the lamb. Sprinkle oregano and basil over the lamb. Top lamb with artichoke hearts, feta cheese, sundried tomatoes, and garlic; season with salt and pepper.<br />Roll the lamb around the stuffing. Bundle the lamb with kitchen twine to keep from unrolling. Wrap lamb in aluminum foil and place in a baking dish.<br />Roast in preheated oven to your desired degree of doneness, or an internal temperature of 150 degrees F (70 degrees C) for medium, about 90 minutes. Set aside to rest in a warm area for 10 minutes before slicing. Reserve pan juices for serving.', 'http://images.media-allrecipes.com/images/44555.gif', 'NEW'),
(154, 'Special Rhubarb Cake', '2 tablespoons butter, softened, 1 cup white sugar, 1 egg, 2 cups all-purpose flour, 1 teaspoon baking powder, 1/2 teaspoon baking soda, 1/2 teaspoon salt, 1 cup buttermilk, 2 cups diced fresh rhubarb, 2 tablespoons melted butter, 1/4 cup all-purpose flour, 1/4 cup white sugar, 1/2 cup butter, 3/4 cup brown sugar, 1/2 cup heavy whipping cream, 1 teaspoon vanilla extract, ', '<br />Preheat oven to 350 degrees F (175 degrees C). Grease a 9-inch square cake pan.<br />Beat 2 tablespoons softened butter and 1 cup white sugar with an electric mixer in a large bowl until light and fluffy. Beat egg into the butter mixture.<br />Mix 2 cups flour, baking powder, baking soda, and salt in a bowl; add flour mixture alternately with buttermilk, to the butter mixture, stirring just to combine into a batter. Fold rhubarb into the batter just until incorporated; pour into prepared pan.<br />Stir 2 tablespoons melted butter, 1/4 cup flour, and 1/4 cup white sugar together in a bowl until evenly moist; sprinkle over the batter.<br />Bake in the preheated oven until a toothpick inserted into the center comes out clean, 35 to 40 minutes. Cool in the pan for 10 minutes before removing to cool completely on a wire rack.<br />Stir 1/2 cup butter, brown sugar, cream, and vanilla together in a saucepan over medium heat; bring to a boil and cook for 1 minute. Serve sauce immediately with the warm cake.', 'http://images.media-allrecipes.com/images/44555.gif', 'NEW');
